  return (
    <Container maxW="8xl" centerContent>
      <Box padding="4" width="80%">
        <Box style={{   width: "100%",
              backgroundColor: "red",}}>
          <input
            type="file"
            id="file"
            style={{
           
              alignItems: "center",
            }}
          />
        </Box>

        <Button bg="#677DB7" color="white" mt="10">
          Upload
        </Button>
        <Images />
      </Box>
    </Container>
  );
}
